import React, { useEffect, useState } from 'react';
import { Route, Routes } from 'react-router-dom';
import Card from '../Card';
import OverviewAction from './OverviewAction';

export default function Overview() {
  const  [overviewData,setOverviewData]=useState()


  const fetchData = async () => {
    let res = await fetch("https://api.randomuser.me/?nat=US&results=1");
    let { results } = res.json();
    console.log(results);
    };
    fetchData();

    useEffect(() => {

      fetch('http://127.0.0.1:5000/token:qwhu67fv56frt5drfx45e/overviews',
      ).then(resp=>resp.json()).then(re=>setOverviewData(re))
      },[])


  // Fetch()
  // console.log(overviewData)


  return (
    <Routes>
      <Route path="/*" element={<OverviewAction overviewData={overviewData}/>}/>
    </Routes>
      );
}
